<!--OK LO STAI GUARDANDO, VA BENE, PECCATO. TI ROVINI LA SORPRESA.-->
<html lang="it">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Arrivo tra</title>
  <style>
    body { font-family: system-ui, sans-serif; max-width: 720px; margin: 40px auto; padding: 0 16px; }
    .bar { width: 100%; height: 22px; border: 1px solid #333; border-radius: 6px; overflow: hidden; }
    .fill { height: 100%; width: 0%; background: #333; transition: width 0.5s linear; }
    .row { display: flex; justify-content: space-between; margin-top: 10px; }
    code { background: #f2f2f2; padding: 2px 6px; border-radius: 4px; }
  </style>
</head>
<body>
  <h1>Tranquilli, sto tornando e manca poco</h1>
  <div class="bar"><div id="fill" class="fill"></div></div>
  <div class="row">
    <div id="pct">0.00%</div>
    <div id="rem"></div>
  </div>
  <p id="final" style="margin-top:16px; font-weight:600;"></p>
  <img src="https://picsum.photos/800/600"
     style="width:100%; height:auto; border-radius:10px; margin:20px 0;">

<script>

  const START = Date.parse("2026-02-25T23:00:00Z");
  const END   = Date.parse("2026-08-31T21:59:59Z");
  const FINAL_LINK = "https://youtu.be/DipzMtLBggc?si=kQwdFKT75JH1JKBI&t=80";

  const fill = document.getElementById("fill");
  const pct  = document.getElementById("pct");
  const rem  = document.getElementById("rem");
  const fin  = document.getElementById("final");

  function clamp(x, a, b){ return Math.max(a, Math.min(b, x)); }

  function fmtRemaining(ms){
    ms = Math.max(0, ms);
    const s = Math.floor(ms/1000);
    const d = Math.floor(s/86400);
    const h = Math.floor((s%86400)/3600);
    const m = Math.floor((s%3600)/60);
    const ss = s%60;
    return `${d}d ${String(h).padStart(2,"0")}:${String(m).padStart(2,"0")}:${String(ss).padStart(2,"0")}`;
  }

  function tick(){
    const now = Date.now();
    const total = END - START;
    const prog = clamp((now - START) / total, 0, 1);

    fill.style.width = (prog*100).toFixed(2) + "%";
    pct.textContent = (prog*100).toFixed(2) + "%";
    rem.textContent = "remaining " + fmtRemaining(END - now);

    if (prog >= 1){
      fin.innerHTML = `ECCOLO!! <a href="${FINAL_LINK}">${FINAL_LINK}</a>`;
    } else {
      fin.textContent = "";
    }
  }
  

  tick();
  setInterval(tick, 1000);
</script>
</body>
</html>
